render(){

    return(
        <div className="Card">
             <img className="card-img-top"
                  src= {this.props.imgSrc}
                  alt="Infelizmente a imagem não abriu, faz refresh da pagina ou tenta mais tarde"> 
             </img>
        <div className="card-text"> 
               <p> {this.props.textInf} </p>
               <a href={this.props.hrefButton} 
                className="btn btn-primary">
                    Go somewhere
             </a>
        </div>
        </div>
    );
}
}

